import { getLineData } from '../api'
import { LineChart } from '@mui/x-charts/LineChart';

function Line() {
    const [lineData, setLineData] = useState([])

    useEffect(() => {
        getLineData()
            .then(res => {
                console.log("Graph data")
                console.log(res)
                setLineData(lineData)
            })
        return () => { }
    }, [])
    return (
        // <div>GraphChart</div>
        <LineChart
            width={500}
            height={300}
            series={[
                { data: pData, label: 'pv' },
                { data: uData, label: 'uv' },
            ]}
            xAxis={[{ scaleType: 'point', data: xLabels }]}
        />
    )
}

export default Line
